import React from 'react';
import { Bot, Activity } from 'lucide-react';

const Header = ({ isConnected }) => {
  return (
    <header className="bg-white shadow-sm border-b border-gray-200">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          <div className="flex items-center space-x-3">
            <div className="flex items-center justify-center w-10 h-10 bg-primary-500 rounded-lg">
              <Bot className="w-6 h-6 text-white" />
            </div>
            <div>
              <h1 className="text-xl font-bold text-gray-900">
                AI Agent Orchestration Hub
              </h1>
              <p className="text-sm text-gray-500">
                Intelligent multi-agent task orchestration
              </p>
            </div>
          </div>

          <div className="flex items-center space-x-2">
            <div className={`flex items-center space-x-2 px-3 py-1 rounded-full text-sm ${
              isConnected 
                ? 'bg-success-50 text-success-600' 
                : 'bg-error-50 text-error-600'
            }`}>
              <Activity className={`w-4 h-4 ${isConnected ? 'animate-pulse' : ''}`} />
              <span>{isConnected ? 'Connected' : 'Disconnected'}</span>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
